import React from 'react'

const Square = ({colorValue, hexValue}) => {
  return (
      <section
      className='square'
      style={{backgroundColor: colorValue}} >
        <p> {colorValue ? colorValue :""} </p>
        <p>{hexValue ? hexValue: null}</p>
      </section>
  )
}

Square.defaultProps = {
    colorValue: "Empty Color Value"
}
export default Square;
